script: |
  super -f text -I q1097.spq | sort > q1097.out

inputs:
  - name: q1097.spq
    data: |
      SELECT DISTINCT - + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 BETWEEN + col0 / 63 + 22 AND + - col2 * - col1 * - col2 * + col2 * + col1 * + - col2 * + + col0;
  - name: tab1

outputs:
  - name: q1097.out
    data: |
      -3
